  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments from June through July of 1938. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, raptors, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments and plantings. Resource management is outlined;
  topics include grazing, sharecropping, and haying. Photographs are attached.\",\n\t\"license_title\":
